// src/pages/TermsOfUse.js
import React from 'react';

const TermsOfUse = () => {
  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold">شروط الاستخدام</h1>
      <p className="mt-4">هنا يمكنك إضافة محتوى شروط الاستخدام الخاصة بك.</p>
    </div>
  );
};

export default TermsOfUse;
